snippet.textDisplay:
Dasht o sahra main phiray aawara,
Rooh e jaana ko chahinay walay;

Khilwatun main sajayain afsaanay,
Mehfilain chod kay aanay walay;

Ishq e haq ab bhi zinda rakhtain hain,
Kar kay wadun ko nibhanay walay;

Din main tarikhiyun say baatain karain,
Raat dar raat jaagnay walay;

Tang say tang tar mohobat ko,
Paday daaman sametnay walay;

Mujhsay bhi uncha hai darjha tera,
Meri chahat ko samajhnay walay;
 - Jazieray

